@Injectable({
  providedIn: 'root'
})
export class PocLibService {

  constructor() { }
}
import { Component } from '@angular/core';

@Component({
  selector: 'poc-pocLib',
  templateUrl: 'poc-lib.component.html',
  styleUrls: ['poc-lib.component.scss'],
})
export class PocLibComponent {

}
<h1>Here it works!</h1>
